"""Function to convert Javascript object into an OpenCv image 

"""

def js_to_image(js_obj):
  image_bytes=b64decode(js_obj.split(',')[1])
  arr=np.frombuffer(image_bytes,dtype=np.uint8)
  img=cv2.imdecode(arr,flags=1)
  return img

